import { margin, padding } from '@mui/system';
import React from 'react';
import { carData } from '../carData';

export const CarList = () => {
    const styles={
        list:{
            textAlign:'left',
            margin:'10px'
        },
        carButton:{
            backgroundColor:'#ECECEC',
            fontSize:'20px',
            padding:'5spx 20px',
            margin:'5px 0px',
            cursor:'pointer',
            width:'100%'
        }
    }
  return (
    <div style={styles.list}>
            {carData.map(car=> (
                <div>
                    <button style={styles.carButton}>{car.Name}</button>
                </div>

            ))}
    </div>
  )
}
